import React from 'react';
import { Card, CardActionArea, CardMedia, CardContent } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    content: {
        paddingLeft: '20px',
        paddingRight: '20px',
        paddingTop: '6px',
        paddingBottom: '6px',
    },
    top: {
        paddingLeft: '20px',
        paddingRight: '20px',
        paddingTop: '12px',
        paddingBottom: '6px',
    },
    end: {
        paddingLeft: '20px',
        paddingRight: '20px',
        paddingTop: '6px',
        paddingBottom: '12px',
    },
    header: {
        marginTop: '0px',
        marginBottom: '0px',
    },
    paper: {
        borderRadius: '8px'
    }
});

const RocketCard = ({ rocketName, image }) => {

    const classes = useStyles();

    return (
        <React.Fragment>
            <Card>
                <CardActionArea>
                    <CardMedia component="img" alt={rocketName} image={image} title={rocketName} />
                    <CardContent>
                        {rocketName}
                    </CardContent>
                </CardActionArea>
            </Card>
        </React.Fragment>
    )
}

export default RocketCard;
